import React, { Component } from "react";
import { RecommendWrapper, RecommendItem } from "../style" 
import { connect } from "react-redux"

class Recommend extends Component {
  render() {
    const {list} = this.props

    return (
      <RecommendWrapper>
        {list.map((item) => {
          return (
            <RecommendItem key={item.id} imgUrl={item.i}></RecommendItem>
          );
        })}

        
        <RecommendItem imgUrl="https://lh3.googleusercontent.com/proxy/Kbo2H1J9Pjg9yysWk8FHNReMGBR-Y7vqsKQE4RdRX0ev22oiHz20jSv3aJzRjZoN4h9lNRAdRo0v_BiHdXz75A0lSR2V4wAa8dA6Cck9p8kf2g"></RecommendItem>
      </RecommendWrapper>
    );
  }
}

const mapStateToProps = (state) => ({
  list: state.getIn(["home","RecommendList"])

})

export default connect(mapStateToProps,null) (Recommend);
